import urllib.parse
import urllib.request
import os
import argparse
import time
from prody import *
import urllib3
import pandas as pd
import numpy as np

urllib3.disable_warnings()


def get_args():
   """
   Self-explanatory. Toodles.
   :return:
   """
   parser = argparse.ArgumentParser(prog='Uniprot_PFAM_Map',
                                    description='Map PFAM ids with UniProtKB accessions!',
                                    epilog='Contact - kumar.singh@wur.nl')
   parser.add_argument('-up', '--uniprot_list_file', default=True, action='store', required=True, help='file with a list of uniprot accessions. One row for one accession')
   parser.add_argument('-o', '--output_file', default=True, action='store', required=True)
   parser.add_argument('-v', '--verbose', default=False, action='store_true', required=False)
   return parser.parse_args()

def convert_file_to_list(query_file):
    accession_list = []
    with open(query_file) as f:
        for line in f:
            temp = line.strip()
            accession_list.append(temp)
    return accession_list


def main():

    query = convert_file_to_list(Options.uniprot_list_file)
    map = {}
    for id in query:
        print(id)
        try:
            temp = searchPfam(id)
        except Exception as e:
            continue
        # print(temp)
        temp2 = []
        for each in temp.keys():
            # print(each)
            temp2.append(each)
        map[id] = ';'.join(temp2)

    map_df = pd.DataFrame(list(map.items()), columns = ['uniprot_id','Pfam_id'])
    map_df.to_csv(Options.output_file, sep="\t", index=False)

    return

if __name__ == "__main__":
    Options = get_args()
    start_time = time.time()
    main()
    end_time = time.time()
    print(end_time - start_time)

